import './App.css';
import Checkout from './Checkout';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/checkout">
            <Checkout />
          </Route>
          <Route path="/users">
            <Users />
          </Route>

        </Switch>
      </Router>
    </div>
  );
}

export default App;
